import React from 'react';
import { Table } from 'react-bootstrap';


class Alunos extends React.Component {

    constructor(props) {
        super(props);
        this.state = {
            alunos: []
        }
    }

    render() {
        return (
            <Table>
                <thead>
                    <tr>
                        <th>Nome</th>
                        <th>E-mail</th>
                        <th>Opções</th>
                    </tr>
                </thead>
            </Table>
        )
    }
}

export default Alunos;
